CREATE TABLE `products` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `productsName` varchar(200) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'tên sản phẩm',
  `productsCode` varchar(45) DEFAULT NULL,
  `description` longtext DEFAULT NULL COMMENT 'Mô tả chi tiết',
  `images` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'danh sách ảnh, screenshort' CHECK (json_valid(`images`)),
  `importPrice` double DEFAULT 0 COMMENT 'giá nhập lần cuối',
  `salePrice` double DEFAULT NULL COMMENT 'giá bán ',
  `productGroupsId` bigint(20) DEFAULT NULL COMMENT 'nhóm sản phẩm',
  `unitsId` bigint(20) DEFAULT NULL,
  `userCreatorsId` bigint(20) NOT NULL,
  `dateCreated` datetime DEFAULT current_timestamp() COMMENT 'ngày tạo',
  `dateUpdated` datetime DEFAULT current_timestamp(),
  `status` int(11) DEFAULT NULL COMMENT '0: chờ duyệt, 1: Hiển thị sản phẩm, -1: xoá sản phẩm',
  `medProducersId` varchar(100) DEFAULT NULL COMMENT 'id nhà sx thuốc',
  `packageName` varchar(200) DEFAULT NULL COMMENT 'cách đóng gói thuốc',
  `countryName` varchar(200) DEFAULT NULL COMMENT 'tên quốc gia',
  `drugContent` varchar(500) DEFAULT NULL COMMENT 'hàm lượng',
  `drugIngredients` varchar(500) DEFAULT NULL COMMENT 'hoạt chât thuốc',
  `registrationNumber` varchar(50) DEFAULT NULL COMMENT 'số đăng ký thuốc',
  `lastInPrice` double DEFAULT 0,
  PRIMARY KEY (`id`),
  KEY `createDate` (`dateCreated`),
  KEY `status` (`status`),
  KEY `usersCreatorId` (`userCreatorsId`),
  KEY `productGroupsId` (`productGroupsId`),
  KEY `unitsId` (`unitsId`)
) ENGINE=InnoDB AUTO_INCREMENT=192 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci COMMENT='sản phẩm';
